INSERT INTO `restaurant` (`id`, `name`, `slogan`, `about`, `speciality`, `phone`, `timezone`, `menu_style`, `promoted`, `image`, `preparation_time`, `min_order_price`, `delivery_free_range`, `currency_id`, `tax_id`, `tax_free`, `cover_image`, `notes`, `user_id`, `added_by`, `created`, `updated`, `google_analytics`, `block`, `res_status`) VALUES
(1, 'Scoma Restaurant', 'House of taste', 'Johansberg, Southafrica', 'Seafood', '+27846743176', '+05:00', 1, 0, 'app/webroot/uploads/1/5c5c2ce03e7b7.png', 45, '20.00', 5, 10, 16, 0, 'app/webroot/uploads/1/5c5c94e3f033d.png', '', 2, 2, '2019-02-07 12:14:29', '2020-01-27 17:50:39', 0, 0, '1'),
(2, 'Subway', 'Subway', 'About', 'Sandwiches', '+919842259924', '-05:00', 1, 1, 'app/webroot/uploads/2/5d8f2a5de8e2f.png', 30, '100.00', 5, 10, 16, 0, 'app/webroot/uploads/2/5d8f2a5e27b20.png', 'ok', 30, 4, '2019-09-28 10:39:41', '2019-09-28 10:58:37', 0, 0, '0'),
(3, 'KFC', 'It\'s Finger Lickin\' Good!', 'Kfc, Also Known As Kentucky Fried Chicken, Is An American Fast Food Restaurant Chain Headquartered In Louisville, Kentucky, That Specializes In Fried Chicken. It Is The World\'s Second-largest Restaurant Chain (as Measured By Sales) After Mcdonald\'s, With 22,621 Locations Globally In 136 Countries As Of December 2018.', 'KFC fried chicken tastes good because it is formulated to taste good.The human mouth craves those flavors and that is what makes you go back for more KFC', '0279999266', '+05:00', 1, 0, 'app/webroot/uploads/3/5d8f38a136600.png', 20, '5.00', 10, 10, 16, 0, 'app/webroot/uploads/3/5d8f38a136a63.png', '', 31, 4, '2019-09-28 11:40:33', '2019-09-28 15:52:57', 0, 0, NULL),
(4, 'Meat and Eat', 'Ready to meat & eat ? Nice to meat you soon', 'Meat & Eat Is A Farm To Fork Indian Chain Of Quick Service (qsr) & Family Restaurants Serving Fresh And Hygienic Veg & Non-veg Fast Food Options To Customers.', ' /meat and eat is Halal food. Halal food is that which adheres to Islamic law, as defined in the Koran.', '0275647548', '+05:00', 1, 1, 'app/webroot/uploads/4/5d8f3b685a097.png', 30, '5.00', 10, 10, 16, 0, 'app/webroot/uploads/4/5d8f3b685a706.png', '', 32, 4, '2019-09-28 11:52:24', '2019-09-28 16:00:26', 0, 0, NULL),
(5, 'Chicking', 'its my choice', 'Chicking Is A Rapidly Growing Fast-food Chain In The Region, Specializing In Serving The Tastiest Crumb Fried Chicken Using A Secret Recipe', ' the combination produces an irresistible repetition of salt and spice, cold and hot, briny and sweet, crunchy and tender.', '0274172425', '+05:00', 1, 1, 'app/webroot/uploads/5/5d8f3d26c4cf9.png', 35, '8.00', 15, 10, 16, 1, 'app/webroot/uploads/5/5d8f3d26c87c2.png', '', 33, 4, '2019-09-28 11:59:50', '2019-09-28 16:00:58', 0, 0, NULL),
(6, 'church\'s chicken', '\'Bringin\' That Down Home Flavor', 'Church\'s Chicken Is An American Chain Of Fast Food Restaurants Specializing In Fried Chicken, Also Trading Outside North America As Texas Chicken. The Chain Was Founded As Church\'s Fried Chicken To Go By George W. Church Sr', 'Church\'s Chicken has a Smokehouse Chicken Combo featuring a half chicken with mashed potatoes and a Honey-Butter Biscuit, all for just $5. Church\'s said their Bourbon Black Pepper Smokehouse Chicken, ', '0275355252', '-05:00', 4, 0, 'app/webroot/uploads/6/5d8f401782257.png', 20, '8.00', 10, 10, 16, 1, 'app/webroot/uploads/6/5d8f4017826df.png', '', 34, 4, '2019-09-28 12:12:23', '2019-09-28 17:28:51', 0, 1, NULL),
(8, 'mcdonald\'s', 'I\'m Lovin\' It', 'The First Mcdonald\'s Restaurant Was Started In 1948 By Brothers Maurice (“mac”) And Richard Mcdonald In San Bernardino, California. They Bought Appliances For Their Small Hamburger Restaurant From Salesman Ray Kroc, Who Was Intrigued By Their Need For Eight Malt And Shake Mixers.', 'McDonald\'s, in full McDonald\'s Corporation, American fast-food chain that is one of the largest in the world', '0277575757', '-05:00', 3, 1, 'app/webroot/uploads/8/5d8f46881ef94.png', 40, '6.00', 17, 10, 16, 0, 'app/webroot/uploads/8/5d8f46881f407.png', '', 36, 4, '2019-09-28 12:39:52', '2019-09-28 16:39:52', 0, 0, NULL),
(9, 'Burger King', 'Be Your Way,Have It Your Way', 'Burger King Corporation, Restaurant Company Specializing In Flame-broiled Fast-food Hamburgers. It Is The Second Largest Hamburger Chain The The United States, After Mcdonald\'s. In The Early 21st Century, Burger King Claimed To Have About 14,000 Stores In Nearly 100 Countries. Headquarters Are In Miami, Florida.', 'It\'s called the Suicide Burger and it\'s completely over-the-top. Including four burger patties, four slices of cheese, bacon, and special sauce, it contains 800 calories, 175mg of cholesterol and 2,43', '0274932514', '-05:00', 3, 1, 'app/webroot/uploads/9/5d8f4b0dd0d77.png', 20, '8.00', 20, 10, 16, 0, 'app/webroot/uploads/9/5d8f4b0dd1889.png', '', 37, 4, '2019-09-28 12:59:09', '2019-09-28 16:59:09', 0, 0, NULL),
(10, 'Domino\'s', 'It\'s what we do', 'About Dominos Pizza India. Jubilant Foodworks Limited (the Company) Is A Jubilant Bhartia Group Company. The Company Was Incorporated In 1995 And Initiated Operations In 1996.', 'Chicken breast, white sauce, smoked bacon, tomatoes and parsley with provolone cheese and mozzarella cheeses on a cheesy provolone crust.', '027546897', '-05:00', 4, 1, 'app/webroot/uploads/10/5d8f4f4e6d451.png', 25, '8.00', 10, 10, 16, 0, 'app/webroot/uploads/10/5d8f4f4e6d98e.png', '', 38, 4, '2019-09-28 13:17:18', '2019-09-28 17:17:18', 0, 0, NULL),
(11, 'cafe coffee day', 'A lot can happen over coffee', 'Café Coffee Day Global Limited Company Is A Chikkamagaluru-based Business Which Grows Coffee In Its Own Estates Of 20,000 Acres. It Is The Largest Producer Of Arabica Beans In Asia, Exporting To Various Countries Including The U.s., Europe, And Japan', 'Find the best place to spend time with friends. Since 1996, Café Coffee Day popularly known as CCD has been resolved to provide the best experience', '0271346798', '-05:00', 2, 1, 'app/webroot/uploads/11/5d8f52eaac62a.png', 20, '7.00', 17, 10, 16, 0, 'app/webroot/uploads/11/5d8f52eaacb7f.png', '', 39, 4, '2019-09-28 13:32:42', '2019-09-28 17:32:42', 0, 0, NULL),
(12, 'church\'s chicken', '‘Bringin’ That Down Home Flavor’', 'Church\'s Chicken Is An American Chain Of Fast Food Restaurants Specializing In Fried Chicken, Also Trading Outside North America As Texas Chicken. The Chain Was Founded As Church\'s Fried Chicken To Go By George W. Church Sr., On April 17, 1952, In San Antonio, Texas, Across The Street From The Alamo.', 'Church\'s Chicken is an American chain of fast food restaurants specializing in fried chicken, also trading outside North America as Texas Chicken.', '0278527946', '-05:00', 3, 0, 'app/webroot/uploads/12/5d8f545c9524f.png', 35, '8.00', 17, 10, 16, 1, 'app/webroot/uploads/12/5d8f545c9605a.png', '', 40, 4, '2019-09-28 13:38:52', '2019-09-28 17:38:52', 0, 0, NULL),
(13, 'Reach Skyline', 'Embrace Digital', 'Ram', 'markettinng', '', '-05:00', 3, 0, 'app/webroot/uploads/13/5d9070ee14d1a.png', 40, '60.00', 50, 10, 16, 0, 'app/webroot/uploads/13/5d9070ee152de.png', '', 41, 4, '2019-09-29 10:23:02', '2019-09-29 14:23:02', 0, 0, NULL),
(14, 'NoQ', 'We Serve Delicious Foods', 'We Serve Delicious Oods', 'food', '2798461663', '-05:00', 2, 1, 'app/webroot/uploads/14/5d91f52886fb0.png', 50, '60.00', 50, 10, 16, 0, 'app/webroot/uploads/14/5d91f52887566.png', '', 43, 4, '2019-09-30 13:59:28', '2019-09-30 17:59:28', 0, 0, NULL),
